import React from "react";

const Learnmore = () => {
  return (
    <div>
      <header>
        <div class="nav container">
          <a href="#" class="logo">
            Anna <span>Daata</span>
          </a>
          <a href="#" class="login">
            Sign Up
          </a>
        </div>
      </header>
      
    </div>
  );
};
export default Learnmore;
